import React, { useState } from "react";
import { ThemeProvider, Modal, Div, Row, Col, Button, Text, Container, Icon } from "atomize";
import NetflixModal from "./NetflixModal"

function MyCliques() {
  const [modal, showModal] = useState(false)

  return(
    <Row d="flex" justify="flex-end">
      <Row d="flex" justify="space-between" align="center">
        <Icon
          name="Add"
          color="black"
          size="30px"
        />
        <Text
          textSize="heading"
          textColor="black"
          fontFamily="secondary"
        >
          MY CLIQUES
        </Text>
      </Row>
      <NetflixModal
        isOpen={modal}
        onClose={() => showModal(false)}
      />
    </Row>
  )
}

export default MyCliques;
